  false,\n\t\"url\": null,\n\t\"notes\": \"These are netCDF format data collected
  by GFNMS and BML to understand the physical processes at Southeast Farallon Island
  and their potential effects on marine ecology. The project goals were: (1) to monitor
  and document physical and biological conditions, (2) to increase understanding of
  the relationship between upwelling / productivity and physical forcing, and (3)
  to educate the public about oceanic processes, in and around the Cordell Bank and
  Gulf of Farallones National Marine Sanctuaries.\",\n\t\"license_title\": null,\n\t\"extras\":
